procedure fibonacci(x)
{
	//root.console.print(x.toString());
	if(x.lt(2))
	{
		if(x.equals(0))		
			result=0;
		else
			result=1;		
	}	
	else
		result = self.fibonacci(x.min(1)).plus( self.fibonacci(x.min(2)) );			
}

procedure sum(n)
{
	if(n.equals(1))
		result = 1;
	else
	{
		n2 = n.min(1);
		s2 = self.sum(n2);
		result = n.plus(s2);
	}
}

