procedure ()
{

	//1. fetch active MAC from AP
	host -> http://root@jackap6;

	data -> host."Status_Wireless.live.asp"();
	//root.console.print(data);
	macList -> root.lib.device.LinkSysE3000.statusWirelessLiveGetMacList(data);
	macList._prototype -> root.prototype.list;

	for(i->0;i.lt(macList.size());i.inc(1))
	{
		mac = macList.get(i);		
		//root.console.print(mac);		
		now = root.lib.system.now();

		self.activeMacs.$mac=now;
	}


	maxIdleTime -> self.maxIdleTime.mul(1000);

	//2. get list of inactive MACs
	activeMacs -> self.activeMacs;	
	activeMacs._prototype -> root.prototype.list;
	//activeMacs.clear();

	toBeRemovedMacs -> {};
	toBeRemovedMacs._prototype=root.prototype.list;
	for(i=0;i.lt(activeMacs.size());i.inc(1))
	{
		mac = activeMacs.get(i);

		now = root.lib.system.now();

		elapse = now.ticks().min( mac.ticks());
		if(elapse.gt(maxIdleTime))
			toBeRemovedMacs.add(mac);	

	}

	//3. remove inactive MACs
	for(i=0; i.lt(toBeRemovedMacs.size());i.inc(1))
	{
		mac = toBeRemovedMacs.get(i);
		activeMacs.$mac = null;
		root.console.print(mac.concat(" removed."));
	}

}

